import { Component } from "react";

class CartDrawer extends Component {
    render() {
        return(
            <div className="cart__drawer">
                <div className="cart__header heading">Cart</div>
                <div className="cart_announcement">SPEND $81.00 MORE AND GET FREE SHIPPING!</div>

                <div className="cart__products">

                </div>

                <div className="cart__total">
                    <div className="cart__note__toggle">Add Order Note</div>
                    <div className="cart__policies">Shipping & taxes calculated at checkout</div>
                    <a href="#" className="btn btn__primary">
                        Checkout
                        <span className="Button__SeparatorDot"></span>
                        $169.00 USD
                    </a>
                </div>
            </div>
        )
    }
}

export default CartDrawer
